export default (function(a,b,c,d,e){return {data:{AHfz0u2qZl:{data:{id:99,attributes:{imdbId:"tt1698641",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BOTgxMDMxMTY5OV5BMl5BanBnXkFtZTgwMjY1NzYzMjE@._V1_SX300.jpg",type:"movie",ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"},{Source:"Rotten Tomatoes",Value:"61%"},{Source:"Metacritic",Value:"54\u002F100"}],item_lang:{data:{id:762,attributes:{title:c,plot:"For 12 year old Alexander Cooper, everyday is a bad day. And his family thinks he's being silly because they never have a bad day. On the day before his 12th birthday party, he learns that another boy is having a party of his own and everyone is going to it. And another kid punks him online. So at midnight of his birthday, he wishes that his whole family can have a bad day. And things for the whole family go bad, his mom's car is broken so they have to share a car, his sister has a cold and has to go on stage, his older brother, who's hoping to get his driver's license and to bring his girlfriend to the prom, has to deal with his girlfriend's snootiness and fails to get his license, his mom has a crisis at work which could cost her her job, and his dad who has a job interview has to bring his younger brother with him but because his pacifier is broken he can't stop crying. Alex feels responsible.",slug:"alexander-and-the-terrible-horrible-no-good-very-bad-day"}}},books:{data:[{id:460,attributes:{title:c,description:"On a day when everything goes wrong for him, Alexander is consoled by the thought that other people have bad days too.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=JN6IRLJx0RcC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b,"Ray Cruz"],firstBook:true,published:"2009-09-22",publisher:e,subtitle:a}},{id:461,attributes:{title:c,description:"Presents the libretto from the musicial featuring Alexander and his very bad day.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=ga7xBKh7q2QC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:["Shelly Markham",b],firstBook:d,published:"1999-01-01",publisher:"Dramatic Publishing",subtitle:"A Musical Based on the Book by Judith Viorst"}},{id:462,attributes:{title:c,description:"He could tell it was going to be a terrible, horrible, no good, very bad day. He went to sleep with gum in his mouth and woke up with gum in his hair. When he got out of bed, he tripped over his skateboard and by mistake dropped his sweater in the sink while the water was running. He could tell it was going to be a terrible, horrible, no good, very bad day. It was a terrible, horrible, no good, very bad day. Nothing at all was right. Everything went wrong, right down to lima beans for supper and kissing on TV. What do you do on a day like that? Well, you may think about going to Australia. You may also be glad to find that some days are like that for other people too.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=AGXinn6juRMC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:d,published:"2012-04-24",publisher:e,subtitle:a}},{id:463,attributes:{title:"Alexander and the terrible, horrible, no good, very bad day",description:"Reading beyond the Basal teacher guide gives the teacher and the children an opportunity to choose appropriate activities following the reading of a favorite book.",thumbnail:a,authors:["Doris Roettger",b,"Perfection Form Company"],firstBook:d,published:"1987-01-01",publisher:a,subtitle:a}},{id:464,attributes:{title:"Alexander and the Terrible, Horrible, No Good, Very Bad Day, Judith Viorst",description:a,thumbnail:a,authors:[b,"Garrett Christopher"],firstBook:d,published:"2004-01-01",publisher:a,subtitle:"A Study Guide"}}]}}},meta:{}}},prerenderedAt:1680940908703}}("","Judith Viorst","Alexander and the Terrible, Horrible, No Good, Very Bad Day",null,"Simon and Schuster"))